import { Hello } from '../hello';

import Layout from "../layout/Layout";


const PageOne = () => (
    <div>
        <Layout>

            <h1>Page one</h1>
            <Hello name="Brian" enthusiasmLevel={50} />
        </Layout>

    </div>
)

export default PageOne;
